import './Navigation.scss';

export default function Navigation(props){
    return (
        <nav className="Navigation">
                {
                    (props.pages != null)
                    ?
                    props.pages.map(
                        page => 
                        (page.slug == 'accueil')
                        ?
                        <NavLink key={page.id}to={'/'}>{page.title.rendered}</NavLink>
                        :
                        <NavLink key={page.id} to={'/' + page.slug}>{page.title.rendered}</NavLink>
                    )
                    :
                    <div></div>
                }
        </nav>
    );
}
